measurements.description:
One well presented flower and one bud on a 26-cm upright inflorescence;  
   dorsal sepal dark green centrally to light green on side edges, wing shaped cordovan pattern radiates from base, bold cordovan veination; 
   synsepal green, light cordovan veination;
   undulate and twisting petals green, magenta basally, cordovan spots and blotches, hirsute edges;
   pouch green overlaid magenta; 
   staminode green overlaid dark cordovan;
	substance firm; texture glossy.
